import React from 'react';
import Navbar from './Navbar'

function App() {
  return (
    <div className="App">
      <Navbar />
      <div className='container'>
        <div className='card card-body'>
          <h2>Faça a pesquisa dos 10 principais repositórios das seguintes linguagens: </h2>
          <ul class="list-inline-center">
            <li class="list-inline-item">Dart</li>
            <li class="list-inline-item">Kotlin</li>
            <li class="list-inline-item">JavaScript</li>
            <li class="list-inline-item">Ruby</li>
            <li class="list-inline-item">Swift</li>
          </ul>
        </div>

      </div>
    </div>
  );
}

export default App;
